const unitData = [
    { index: 1, name: "cups" },
  
    { index: 2, name: "tbsp" },
  
    { index: 3, name: "tsp" },
  
    { index: 4, name: "ml" },
  
    { index: 5, name: "oz" },
  
    { index: 6, name: "g" },
  
    { index: 7, name: "fl oz" }
  ];
  
  export default unitData;
